import React from 'react';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  Box,
  Chip,
  List,
  ListItem,
  ListItemText,
  Divider,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import {
  Event,
  LocationOn,
  AccessTime,
  Category,
} from '@mui/icons-material';

const StyledCard = styled(Card)(({ theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  transition: 'transform 0.2s',
  '&:hover': {
    transform: 'scale(1.02)',
  },
}));

const EventItem = ({ event }) => (
  <StyledCard elevation={3}>
    <CardContent>
      <Box display="flex" justifyContent="space-between" alignItems="center" mb={2}>
        <Typography variant="h5" component="div" color="primary">
          {event.title}
        </Typography>
        <Chip 
          label={event.category} 
          color="primary" 
          size="small"
          icon={<Category />} 
        />
      </Box>
      <List>
        <ListItem>
          <Event color="action" sx={{ mr: 2 }} />
          <ListItemText primary={event.date} />
        </ListItem>
        <ListItem>
          <AccessTime color="action" sx={{ mr: 2 }} />
          <ListItemText primary={event.time} />
        </ListItem>
        <ListItem>
          <LocationOn color="action" sx={{ mr: 2 }} />
          <ListItemText primary={event.venue} />
        </ListItem>
      </List>
      <Typography variant="body2" color="text.secondary" mt={2}>
        {event.description}
      </Typography>
    </CardContent>
  </StyledCard>
);

const Events = () => {
  const upcomingEvents = [
    {
      title: "Idea Ignite Hackathon",
      date: "Dec 9 - 12, 2024",
      time: "9:00 AM - 5:00 PM",
      venue: "Main Auditorium",
      category: "Technical",
      description: "A national level hackathon focusing on innovative solutions for real-world problems."
    },
    {
      title: "CAS (AI Fusion 2024)",
      date: "Dec 11 - 26, 2024",
      time: "10:00 AM - 4:00 PM",
      venue: "AI Lab",
      category: "Workshop",
      description: "Intensive workshop on artificial intelligence and its applications in modern technology."
    },
    {
      title: "iTech Hackfest 2024",
      date: "Dec 12 - 14, 2024",
      time: "9:00 AM - 6:00 PM",
      venue: "IT Block",
      category: "Competition",
      description: "A platform for students to showcase their technical skills and innovative ideas."
    }
  ];

  const technicalEvents = [
    {
      title: "IEEE - PROJECT EXPO 2024",
      date: "Dec 21, 2024",
      time: "9:30 AM - 4:30 PM",
      venue: "Engineering Block",
      category: "Exhibition",
      description: "Annual project exhibition showcasing innovative student projects."
    },
    {
      title: "E-Bike Design Challenge 2024",
      date: "Dec 26, 2024",
      time: "10:00 AM - 5:00 PM",
      venue: "Mechanical Block",
      category: "Competition",
      description: "Design competition focused on sustainable electric bike solutions."
    }
  ];

  const culturalEvents = [
    {
      title: "Ekklesia'24",
      date: "Jan 6 - 11, 2025",
      time: "9:00 AM - 6:00 PM",
      venue: "College Ground",
      category: "Cultural",
      description: "Annual cultural festival featuring music, dance, and theatrical performances."
    },
    {
      title: "Grand Technical Carnival",
      date: "Jan 20 - 31, 2025",
      time: "10:00 AM - 5:00 PM",
      venue: "Various Locations",
      category: "Technical",
      description: "A month-long celebration of technology and innovation."
    }
  ];

  return (
    <Box>
      {/* Hero Section */}
      <Box
        sx={{
          bgcolor: 'primary.main',
          color: 'white',
          py: 6,
          mb: 6,
          textAlign: 'center',
        }}
      >
        <Container>
          <Typography variant="h2" gutterBottom>
            Events @ SECE
          </Typography>
          <Typography variant="h6">
            Discover exciting events and activities happening at Sri Eshwar
          </Typography>
        </Container>
      </Box>

      <Container sx={{ mb: 8 }}>
        {/* Upcoming Events */}
        <Typography variant="h3" gutterBottom textAlign="center">
          Upcoming Events
        </Typography>
        <Grid container spacing={4} sx={{ mb: 8 }}>
          {upcomingEvents.map((event, index) => (
            <Grid item xs={12} md={4} key={index}>
              <EventItem event={event} />
            </Grid>
          ))}
        </Grid>

        {/* Technical Events */}
        <Typography variant="h3" gutterBottom textAlign="center">
          Technical Events
        </Typography>
        <Grid container spacing={4} sx={{ mb: 8 }}>
          {technicalEvents.map((event, index) => (
            <Grid item xs={12} md={6} key={index}>
              <EventItem event={event} />
            </Grid>
          ))}
        </Grid>

        {/* Cultural Events */}
        <Typography variant="h3" gutterBottom textAlign="center">
          Cultural Events
        </Typography>
        <Grid container spacing={4}>
          {culturalEvents.map((event, index) => (
            <Grid item xs={12} md={6} key={index}>
              <EventItem event={event} />
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Events;
